          <div className="col-xxl-6 col-xl-6 col-lg-5 col-md-12 col-sm-12 col-12">
            <div className="TotalOpenings_input_div">
              <span>
                <BiSearch />
              </span>
              <input
                type="email"
                className="form-control"
                placeholder="Search jobs by title or department"
